    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT - col1 * - col2 + - col2 + col0 + + col0 + col1 * - ( - - col0 ) NOT BETWEEN - col0 AND - col1 + col2;
  - name: tab1

outputs:
  - name: q5820.out
    data: |
      85	5	59
